import { useRef } from "react"

export default function FriendCard({ friend }) {
    const domain = useRef(process.env.REACT_APP_SERVER_SERVICE);

    return (
        <div className="row">
            <div className="wrap-avatar">
                <span className="activity-status activity-status-online" />
                <img
                    className="avatar-small"
                    src={`${domain.current}/uploads/${friend.avatar}`}
                    alt="avatar"
                />
            </div>

            <p className="flex align-items-center ml-8">{friend.firstName + " " + friend.lastName}</p>

        </div>
    )
}
